    [],nt"revision_timestamp": "2013-03-15T11:37:01.826317",nt"name": "accuracy-assessment-points-for-voyageurs-national-park-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "Thematic accuracy requirements for the
    USGS-NPS Vegetation Mapping Program specify 80% accuracy for each map unit that
    represents USNVC floristic types. A total of 1288 accuracy assessment (AA) sites
    were selected at Voyageurs National Park and environs for a thematic AA analysis
    of the project's vegetation spatial database coverage. The field data were collected
    during the summers of 1997 and 1998. Data from 1251 sites were used for the AA analysis.
    Sites not used for the analysis were due to site inaccessibility, insufficient data
    collected, significant change in the landscape, or unmanageable error in the global
    positioning system (GPS) coordinate. Regardless of the data usability to the analysis,
    all 1288 AA sites are represented in the spatial database with explanations. The
    estimated overall accuracy for the vegetation map units is 82.4%.",nt"license_title":
